import React from "react";

export const Paginado = ({dogsPage, allDogs, paginado}) => {
    const pageNumber = [];
    for(let i = 0; i <= Math.ceil(allDogs/dogsPage); i++){
        pageNumber.push(i + 1)
    }

    return(
        <>
            <div>
                <nav>
                <ul>
                    {
                        pageNumber && 
                        pageNumber.map( num => {
                            return (
                            <li>
                                <a onClick = {() => paginado(num)}>{num}</a>
                            </li>
                        )})
                    }
                </ul>
                </nav>
            </div>
        </>
    )
};
